import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import reportWebVitals from './reportWebVitals';
import Resort from './Resort';

const resorts = new Map()
resorts.set("Keystone", [39.6069742, -105.97011])
resorts.set("Breckenridge", [39.4808, -106.0676])
const appId = "1fc3b06f07bf594c3e96a179830ecd4c";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    {[...resorts.keys()].map((item)=>{
      return <Resort resortName={item} lat={resorts.get(item)[0]} lon={resorts.get(item)[1]} appid={appId} />
    })}
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
